            ? <Route path='/waiter' element={<Waiter />}/>
            : null
          } */}
          <Route path='/kitchen' element={<Kitchen />}/>
          {/* { dataUser?.user.roles.chef
            ? <Route path='/chef' element={<Kitchen />}/>
            : null
          } */}
          <Route element={<NotFound/>} />
        </Routes>
    </Router>
  );
}

export default router;
